    parameters:
    - id: docIds
      type: System.Collections.Generic.IEnumerable{System.String}
      description: >-
        The list of Paper doc IDs that can be used to access the given

        Paper docs or supplied to other API methods. The list is sorted in the order

        specified by the initial call to <xref href="Dropbox.Api.Paper.Routes.PaperUserRoutes.DocsListAsync(Dropbox.Api.Paper.ListPaperDocsArgs)" data-throw-if-not-resolved="false"></xref>.
    - id: cursor
      type: Dropbox.Api.Paper.Cursor
      description: >-
        Pass the cursor into <xref href="Dropbox.Api.Paper.Routes.PaperUserRoutes.DocsListContinueAsync(Dropbox.Api.Paper.ListPaperDocsContinueArgs)" data-throw-if-not-resolved="false"></xref> to

        paginate through all files. The cursor preserves all properties as specified in the

        original call to <xref href="Dropbox.Api.Paper.Routes.PaperUserRoutes.DocsListAsync(Dropbox.Api.Paper.ListPaperDocsArgs)" data-throw-if-not-resolved="false"></xref>.
    - id: hasMore
      type: System.Boolean
      description: >-
        Will be set to True if a subsequent call with the provided

        cursor to <xref href="Dropbox.Api.Paper.Routes.PaperUserRoutes.DocsListContinueAsync(Dropbox.Api.Paper.ListPaperDocsContinueArgs)" data-throw-if-not-resolved="false"></xref> returns

        immediately with some results. If set to False please allow some delay before

        making another call to <xref href="Dropbox.Api.Paper.Routes.PaperUserRoutes.DocsListContinueAsync(Dropbox.Api.Paper.ListPaperDocsContinueArgs)" data-throw-if-not-resolved="false"></xref>.
